inline double getDistance(double x, double y)
{
	return sqrt(x*x + y*y);
}
double Calc_Distance(XYPosition p1, XYPosition p2)
{
	double length = 0;
	length = sqrt((p1.x - p2.x)*(p1.x - p2.x) + (p1.y - p2.y)*(p1.y - p2.y));
	return length;
}

//¹¤¾ßº¯Êý£º·µ»Ø×îÐ¡Öµ
inline double min(double a, double b)
{
	return (a < b) ? a : b;
}
//¹¤¾ßº¯Êý£º·µ»Ø×î´óÖµ
inline double max(double a, double b)
{
	return (a > b) ? a : b;
}


//ÊäÈëx,y¾ø¶Ô×ø±ê£¬·µ»ØÏà¶Ô¼¶×ø±ê,·µ»ØµÄÏà¶Ô½Ç¶È·¶Î§Îª(-180,180)
PolarPosition getRelatedPolarPosition(XYPosition xy)
{
	PolarPosition relatedPosition;
	double deltaX = xy.x - info.self.xy_pos.x;
	double deltaY = xy.y - info.self.xy_pos.y;
	relatedPosition.distance = getDistance(deltaX, deltaY);
	double temp = atan(deltaY / deltaX) * 180 * INVPI;
	if (deltaX < 0)
		temp += 180;
	relatedPosition.angle = temp - info.self.view_angle;
	while (relatedPosition.angle < -180)
		relatedPosition.angle += 360;
	while (relatedPosition.angle > 180)
		relatedPosition.angle -= 360;
	return relatedPosition;
}

//ÖØÔØ²Ù×÷·û+£¬¿ÉÒÔÖ±½Ó°ÑÁ½¸ö×ø±êÏà¼Ó
XYPosition operator+(const XYPosition &a,const XYPosition &b)
{
	return { a.x + b.x,a.y + b.y };
}
//ÖØÔØ²Ù×÷·û-£¬¿ÉÒÔÖ±½Ó°ÑÁ½¸ö×ø±êÏà¼õ
XYPosition operator-(const XYPosition &a,const XYPosition &b)
{
	return { a.x - b.x,a.y - b.y };
}
//ÖØÔØ²Ù×÷·û==£¬ÅÐ¶ÏÁ½¸ö×ø±ê¼äµÄ¾àÀëÊÇ·ñÐ¡ÓÚSMALL
bool operator==(const XYPosition &a, const XYPosition &b)
{
	return (abs(a.x - b.x) + abs(a.y - b.y) < SMALL);
}


//»ñµÃ¶¾È¦Ïà¶ÔÎ»ÖÃ£¬Ö±½Ó¸Ä±äPosionRelatedPositionµÄÖµ,·µ»ØµÄÏà¶Ô½Ç¶È·¶Î§Îª(-180,180)
//Õâ¸öº¯Êý¸üÐÂPosionRelatedLocationµÄÖµ£¬±ØÐëÔÚÃ¿Ò»Ö¡µ÷ÓÃÒ»´Îºó²ÅÄÜÕýÈ·Ê¹ÓÃPosionRelatedLocation£¬
//ÇëÎðÔÚÒ»Ö¡Ö®ÄÚ¶à´Îµ÷ÓÃ£¬ÒÔÃâÓ°ÏìÐ§ÂÊ
void getPoisonRelatedLocation()
{
	XYPosition deltaPosionPosition;
	static XYPosition lastPositionXYPosition = { 500,500 };

	if (info.poison.move_flag == 0)
	{
		Poison_next_XYPosition = PoisonXYPosition = { 500,500 };
		Poison_next_radius = Poison_current_radius = 1000;
	}
	else if (info.poison.move_flag == 3)
	{
		Poison_next_XYPosition = PoisonXYPosition = lastPositionXYPosition;
		Poison_next_radius = Poison_current_radius = 0;
	}
	else
	{
		PoisonXYPosition = info.poison.current_center;
		Poison_next_XYPosition = info.poison.next_center;
		Poison_current_radius = info.poison.current_radius;
		Poison_next_radius = info.poison.next_radius;
	}
	lastPositionXYPosition = PoisonXYPosition;

	//middle_of_current_next_posion_xy = { 0.5 * (PoisonXYPosition.x + Poison_next_XYPosition.x),0.5 * (PoisonXYPosition.y + Poison_next_XYPosition.y) };
	//middle_of_current_next_posion_radius = 0.5 * (Poison_current_radius + Poison_next_radius);
	const vector<int> poison_frames = { 200,400,600,800,980,1180,1340,1540,1680,1880,2000,2200,2300,2450,2530,2630,2690,2790,2830 };
	if (info.poison.move_flag == 1 || info.poison.move_flag == 0)
	{
		//Èç¹û¶¾È¦ÕýÔÚÒÆ¶¯£¬ÔòÖÐÐÄÈ¦¶¨ÎªÏÂÒ»¸öÈ¦¡£
		middle_of_current_next_posion_xy = Poison_next_XYPosition;
		middle_of_current_next_posion_radius = Poison_next_radius;
	}
	else if (info.poison.move_flag == 2)
	{
		int last_poison_frame = 0;
		
		for (int i = 0; i < poison_frames.size() && poison_frames[i] < frame; i++)
		{
			last_poison_frame = poison_frames[i];
		}
		middle_of_current_next_posion_xy.x = (Poison_next_XYPosition.x - PoisonXYPosition.x) / (info.poison.rest_frames + frame - last_poison_frame) * (frame - last_poison_frame) + PoisonXYPosition.x;
		middle_of_current_next_posion_xy.y = (Poison_next_XYPosition.y - PoisonXYPosition.y) / (info.poison.rest_frames + frame - last_poison_frame) * (frame - last_poison_frame) + PoisonXYPosition.y;
		middle_of_current_next_posion_radius = (Poison_next_radius - Poison_current_radius) / (info.poison.rest_frames + frame - last_poison_frame) * (frame - last_poison_frame) + Poison_current_radius;
	}
	else
	{
		middle_of_current_next_posion_xy = PoisonXYPosition;
	}




	deltaPosionPosition.x = PoisonXYPosition.x - info.self.xy_pos.x;
	deltaPosionPosition.y = PoisonXYPosition.y - info.self.xy_pos.y;

	PoisonRelatedPosition.distance = getDistance(deltaPosionPosition.x, deltaPosionPosition.y);
	PoisonAbsolutePosition.distance = PoisonRelatedPosition.distance;
	double temp = atan(deltaPosionPosition.y / deltaPosionPosition.x) * 180 * INVPI;
	if (deltaPosionPosition.x < 0)
		temp += 180;
	PoisonAbsolutePosition.angle = temp;
	while (PoisonAbsolutePosition.angle < -180)
		PoisonAbsolutePosition.angle += 360;
	while (PoisonAbsolutePosition.angle > 180)
		PoisonAbsolutePosition.angle -= 360;
	PoisonRelatedPosition.angle = temp - info.self.view_angle;
	while (PoisonRelatedPosition.angle < -180)
		PoisonRelatedPosition.angle += 360;
	while (PoisonRelatedPosition.angle > 180)
		PoisonRelatedPosition.angle -= 360;
}
