inline void refreshMoveAngle()
{
	if (abs(positionRecord::getPosition(0).y - positionRecord::getPosition(-1).y) + abs(positionRecord::getPosition(0).x - positionRecord::getPosition(-1).x) < SMALL)
		return;
	else
	{
		info_self_move_angle = 180 * INVPI*atan2((positionRecord::getPosition(0).y - positionRecord::getPosition(-1).y), (positionRecord::getPosition(0).x - positionRecord::getPosition(-1).x));
		while (info_self_move_angle < 0)
			info_self_move_angle += 360;
		while (info_self_move_angle >= 360)
			info_self_move_angle -= 360;
	}
}

//ÒÆ¶¯Ïà¹Ø
void AI_move(double moveAngle, double viewAngle)
{
	double current_move_angle = info.self.view_angle + moveAngle;
	while (current_move_angle >= 360)
	{
		current_move_angle -= 360;
	}
	while (current_move_angle < 0)
	{
		current_move_angle += 360;
	}

	static int count = 1;

	//f << "\tlast positon\t" << position[0].x << "\t " << position[0].y << std::endl;
	//std::cout << "\tmove: " << moveAngle << "\tview: " << viewAngle << std::endl;
	fileOut << "\tmove: " << moveAngle << "\tview: " << viewAngle << std::endl;
	while (moveAngle < 0)
	{
		moveAngle += 360;
	}
	while (viewAngle < 0)
	{
		viewAngle += 360;
	}
	while (moveAngle > 360)
	{
		moveAngle -= 360;
	}
	while (viewAngle > 360)
	{
		viewAngle -= 360;
	}


	if (abs(info_self_move_angle - current_move_angle) < SMALL && count)
	{
		count--;
		if (count <= 0)
			count = 0;
		move(moveAngle, viewAngle, NOMOVE);
	}
	else
	{
		move(moveAngle, viewAngle);
		count = 1;
	}

	info_self_move_angle = current_move_angle;
}

enum directionType { LEFT, RIGHT };
enum searchStatus { FREE, STUCK };

struct searcher
{
	int stuckLevel;
	directionType type;
	XYPosition xy;
	XYPosition target;
	int viewAngle;
};


static char  visited[1000][1000];
//Ê¹ÓÃB*Ëã·¨·µ»ØÕýÈ·µÄÏà¶Ô·½Ïò£¬·¶Î§(-180,180)
//Ê¹ÓÃÊ±Çë°üº¬"boolMap.h"
