struct Item_and_XY
{
	Item item;
	XYPosition XY_pos;
};
Item searchItem()
{
	static vector<Item_and_XY> surroundingItems;


	static int lastPickTimes = 0;
	static int lastIdealIndex = 0;

	if (pickTimes - lastPickTimes >= 1)
	{
		surroundingItems.erase(surroundingItems.begin() + lastIdealIndex);
	}
	lastPickTimes = pickTimes;

	double maxSearchingRadius;

	if (info.poison.move_flag == 0 || middle_of_current_next_posion_radius > 500)
	{
		maxSearchingRadius = 500;
	}
	else
	{
		maxSearchingRadius = middle_of_current_next_posion_radius;
	}

	static double bandWide = 10;
	if (Calc_Distance(info.self.xy_pos, middle_of_current_next_posion_xy) > 0.8 * maxSearchingRadius)
		bandWide = 0;
	else if (Calc_Distance(info.self.xy_pos, middle_of_current_next_posion_xy) > 0.7 * maxSearchingRadius)
		bandWide = min(3, 0.3 * (0.8 * maxSearchingRadius - Calc_Distance(info.self.xy_pos, middle_of_current_next_posion_xy)));
	else
		bandWide = min(3, 0.03 * maxSearchingRadius) + 0.8 * (0.7 * maxSearchingRadius - Calc_Distance(info.self.xy_pos, middle_of_current_next_posion_xy));
	fileOut << endl << "\tbandWide: " << bandWide << endl;


	for (int i = 0; i < surroundingItems.size(); i++)
	{
		PolarPosition temp = getRelatedPolarPosition(surroundingItems[i].XY_pos);
		if (abs(temp.angle) < 0.5 * info.self.view_width)
		{
			//fileOut << endl << "erase " << surroundingItems[i].item.item_ID << "   (" << surroundingItems[i].XY_pos.x << "," << surroundingItems[i].XY_pos.y << ")   " << "  angle: " << temp.angle << endl;
			auto Iter = surroundingItems.begin() + i;
			surroundingItems.erase(Iter);
			i--;

		}
	}

	for (int i = 0; i < info.items.size(); i++)
	{
		surroundingItems.push_back({ info.items[i],getXYPosition(info.items[i].polar_pos) });
	}

	//fileOut << endl << "\tsurrounding Items: " << endl;
	//for (int i = 0; i < surroundingItems.size(); i++)
	//{
	//	fileOut << "\t\t" << "ID: " << surroundingItems[i].item.item_ID << "   type: " << surroundingItems[i].item.type << "   xy: (" << surroundingItems[i].XY_pos.x << "," << surroundingItems[i].XY_pos.y << ")" << endl;
	//}
	//fileOut << endl;

	Item emptyItem;
	emptyItem.item_ID = -1;
	Item ideal_item;
	ideal_item.item_ID = -1;
	ideal_item.polar_pos.distance = 9999999;
	for (int i = 0; i < surroundingItems.size(); i++)
	{
		Item tempItem = surroundingItems[i].item;
		tempItem.polar_pos = getRelatedPolarPosition(surroundingItems[i].XY_pos);


		double angle = tempItem.polar_pos.angle - targetPosition.angle;
		while (angle > 180)
		{
			angle -= 360;
		}
		while (angle <= -180)
		{
			angle += 360;
		}
		if (tempItem.type == 18 || tempItem.type == 19 || tempItem.type == 20
			|| (tempItem.type == 17 && info.self.vocation != 2)) {
			continue;
		}
		if (((angle < 90) && (angle > -90) && abs(tempItem.polar_pos.distance * sin(angle / 180 * PI)) < bandWide) || tempItem.polar_pos.distance < bandWide && tempItem.polar_pos.distance < targetPosition.distance)
		{
			if (tempItem.polar_pos.distance < ideal_item.polar_pos.distance)
			{
				lastIdealIndex = i;
				ideal_item = tempItem;
			}
		}
	}

	return ideal_item;
}


